  false,\n\t\"url\": null,\n\t\"notes\": \"Benthic habitat maps of the moderate-depth
  marine environment of St. John, U.S. Virgin Islands were created using a combination
  of semi-automated classification and visual interpretation techniques of acoustic
  imagery. The objective of this effort, conducted by NOAA's Center for Coastal Monitoring
  and Assessment - Biogeography Branch in partnership with the U.S. National Park
  Service (NPS), was to provide spatially-explicit information describing the moderate-depth
  (30 - 60 m) benthic habitat types and live coral cover present in and around VICRNM's
  southern boundaries. The data contained in this shapefile represent the position
  of the drop camera as it drifted over 299 accuracy assessment (AA) sites explored
  by NOAA field scientists.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
